export default function Index({ entries }) {
  return (
    <div>
      {entries.map(({ body, title }, idx) => (
        <div key={idx}>
          <h2>{title}</h2>
          <div>{body}</div>
        </div>
      ))}
    </div>
  );
}

export async function getStaticProps() {
  return {
    props: { entries: [{ body: "for the win" }] },
  };
}
